            <div className = "outer">
                <SlotMachine x = '😃' y = '😃' z = '😃' />
                <SlotMachine x = '😿' y = '😃' z = '😃' />
                <SlotMachine x = '😃' y = '😆' z = '🍀' />           
                <SlotMachine x = '🙃' y = '🙃' z = '🙃' />
                <SlotMachine x = '😉' y = '💃' z = '💃' />
                <SlotMachine x = '👩' y = '👩' z = '👩' />
            </div>
        </>
    );
};

export default App;
